import React from 'react';
import Star from '../assets/star.png'; 
import "../Locations.css";

const RatingStars = ({ rating }) => {
    const starArray = [];
    const totalStars = 5; // Total number of stars

    for (let i = 1; i <= totalStars; i++) {
        let starClassName = "star-empty";
        if (i <= rating) {
            starClassName = "star-filled";
        } else if (i <= Math.ceil(rating)) {
            starClassName = "star-filled";
            starArray.push(
                <div key={i} className="star-background" style={{ backgroundColor: 'red' }}>
                    <img src={Star} alt="star" className={starClassName} />
                </div>
            );
            continue; // Skip adding the normal star
        }

        starArray.push(<img key={i} src={Star} alt="star" className={starClassName} />);
    }

    return (
        <div className="rating-stars">
            {starArray}
        </div>
    );
};

export default RatingStars;
